  function go() {
    const margin = 16;
    const yValue = 294;
    let alignAccumulator = 24;

    const entryPriceElem = document.getElementById("entry-price-stat");
    const exitPriceElem = document.getElementById("exit-price-stat");
    const leverageElem = document.getElementById("leverage-stat");
    const walletElem = document.getElementById("wallet-stat");

    let width = entryPriceElem.getBBox().width;
    entryPriceElem.setAttribute("transform", "translate(" + alignAccumulator + ", " + yValue + ")");
    alignAccumulator += width + margin;

    width = exitPriceElem.getBBox().width;
    exitPriceElem.setAttribute("transform", "translate(" + alignAccumulator + ", " + yValue + ")");
    alignAccumulator += width + margin;

    width = leverageElem.getBBox().width;
    leverageElem.setAttribute("transform", "translate(" + alignAccumulator + ", " + yValue + ")");
    alignAccumulator += width + margin;

    if (walletElem) {
      width = walletElem.getBBox().width;
      walletElem.setAttribute("transform", "translate(" + alignAccumulator + ", " + yValue + ")");
      alignAccumulator += width + margin;
    }
  }
